import React from 'react';
import ReactDOM from 'react-dom';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

import './index.css';
import * as serviceWorker from './serviceWorker';
import LandingPage from './pages/LandingPage/home';
import TopProvincePage from './pages/TopProvince/TopProvince';
import TopPlacesPage from './pages/TopPlaces/TopPlaces';
import Maps from './pages/Maps/maps';
import Maps01 from './pages/Maps/mapsProv01';
import Maps02 from './pages/Maps/mapsProv02';
import Maps03 from './pages/Maps/mapsProv03';
import Maps04 from './pages/Maps/mapsProv04';
import Maps05 from './pages/Maps/mapsProv05';
import Maps06 from './pages/Maps/mapsProv06';
import Maps07 from './pages/Maps/mapsProv07';
import Maps08 from './pages/Maps/mapsProv08';
import Maps09 from './pages/Maps/mapsProv09';
import Maps10 from './pages/Maps/mapsProv10';

const Home = (props) => {
    console.log(props);
    return <h1>Props received jaaa</h1>
}

ReactDOM.render(
    <React.StrictMode>
        <Router>
            <Switch>
                <Route exact path="/">
                    <LandingPage />
                </Route>
                <Route path="/province">
                    <TopProvincePage />
                </Route>
                <Route path="/places">
                    <TopPlacesPage />
                </Route>
                <Route path="/maps">
                    <Maps />
                </Route>

                <Route path="/top1Province/:pname">
                    <Maps01 />
                </Route>
                <Route path="/top2Province">
                    <Maps02 />
                </Route>
                <Route path="/top3Province">
                    <Maps03 />
                </Route>
                <Route path="/top4Province">
                    <Maps04 />
                </Route>
                <Route path="/top5Province">
                    <Maps05 />
                </Route>
                <Route path="/top6Province">
                    <Maps06 />
                </Route>
                <Route path="/top7Province">
                    <Maps07 />
                </Route>
                <Route path="/top8Province">
                    <Maps08 />
                </Route>
                <Route path="/top9Province">
                    <Maps09 />
                </Route>
                <Route path="/top10Province">
                    <Maps10 />
                </Route>

            </Switch>
        </Router>
    </React.StrictMode>,
document.getElementById('root')
);

serviceWorker.unregister();
